->\n\n<!-- wp:group {\"tagName\":\"section\",\"className\":\"py-lg-5 pt-5 pt-lg-0 pb-5\"} -->\n<section class=\"wp-block-group py-lg-5 pt-5 pt-lg-0 pb-5\"><!-- wp:columns {\"className\":\"container pb-lg-5 mb-lg-2\"} -->\n<div class=\"wp-block-columns container pb-lg-5 mb-lg-2\"><!-- wp:column {\"className\":\"align-items-center pb-lg-3 mx-0 col-md-12 px-0 form-wrapper\"} -->\n<div class=\"wp-block-column align-items-center pb-lg-3 mx-0 col-md-12 px-0 form-wrapper\"><!-- wp:heading {\"level\":3,\"className\":\"ultra-bold mb-4 pb-0 pb-lg-2 text-center\"} -->\n<h3 class=\"ultra-bold mb-4 pb-0 pb-lg-2 text-center\">Contact Form</h3>\n<!-- /wp:heading -->\n\n<!-- wp:create-block/contact-form -->\n<div class=\"wp-block-create-block-contact-form\"><form class=\"ex-form mx-auto\"><div class=\"form-group\"><label for=\"name\" class=\"name\">Your Name</label><input type=\"text\" class=\"form-control\" id=\"name\"/></div><div class=\"form-group\"><label for=\"email\" class=\"email\">Your Email</label><input type=\"email\" class=\"form-control\" id=\"email\"/></div><div class=\"form-group\"><label for=\"phone\" class=\"phone\">Your Phone</label><input type=\"number\" class=\"form-control\" id=\"phone\"/></div><div class=\"form-group\"><label for=\"message\" class=\"message\">Your Message</label><textarea class=\"form-control\" id=\"message\" rows=\"7\"></textarea></div><button type=\"submit\" class=\"btn btn-primary\">Submit</button></form></div>\n<!-- /wp:create-block/contact-form --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns --></section>\n<!-- /wp:group -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', 'Contact', '', 'inherit', 'closed', 'closed', '', '8-revision-v1', '', '', '2022-01-19 08:57:23', '2022-01-19 08:57:23', '', 8, 'http://localhost/u-digital-test/?p=170', 0, 'revision', '', 0),
